  import { Routes, Route} from "react-router-dom";
  import { useState } from "react";
  // import UserList from "../components/Crud User/UserList";
  // import AddUser from "../components/Crud User/AddUser";
  // import EditUser from "../components/Crud User/EditUser";
  // import Login from "../components/Page/Home/Login";
  // import Register from "../components/Page/Home/Register";
  import Home from '../components/Page/Home/Home'
  import Headers from "../components/Page/Dashboard/Headers";
  import AuthRoutes from "./AuthRoutes";
import UserRoutes from "./UserRoutes";

  function AppRoutes() {
    const [darkMode, setDarkMode] = useState(false);

    const toggleDarkMode = () => {
      setDarkMode(!darkMode);
    };
    return (
      <div className={`${darkMode && "dark"}`}>
        <Headers toggleDarkMode={toggleDarkMode} darkMode={darkMode}  />
      <Routes>
        <Route path="/" element={<Home/>}/>
        <Route path="/Headers" element={<Headers />}/>
        <Route path="login" element={<AuthRoutes />} />
        <Route  element={<UserRoutes />}/>
      </Routes>
      </div>
    );
  }

  export default AppRoutes;
